import React from "react";
import {
  MDBContainer,
  MDBBtn,
  MDBModal,
  MDBModalBody,
  MDBTableHead,
  MDBModalHeader,
  MDBModalFooter,
  MDBTable,
  TableBody,
  MDBIcon
} from "mdbreact";

class ModalAgentes extends React.Component {
  toggle = nr => () => {
    let modalNumber = "modal" + nr;
    this.setState({
      [modalNumber]: !this.state[modalNumber]
    });
  };
  render() {
    return (
      <MDBContainer>
        <MDBBtn onClick={this.toggle(10)}>Launch MDBModal</MDBBtn>
        <MDBModal isOpen={this.state.modal10} toggle={this.toggle(10)}>
          <MDBModalHeader toggle={this.toggle(10)}>
            {this.props.title}
          </MDBModalHeader>
          <MDBModalBody>
            <MDBTable striped>
              <MDBTableHead>
                <tr>
                  <th>Legajo</th>
                  <th>Apellido y Nombre</th>
                  <th>DÃ­as descuento</th>
                </tr>
              </MDBTableHead>
              <TableBody>
                {this.props.agentes.map((item, i) => {
                  return (
                    <tr>
                      <td>{item.legajo}</td>
                      <td>{item.nombre}</td>
                      <td>5</td>
                    </tr>
                  );
                })}
              </TableBody>
            </MDBTable>
          </MDBModalBody>
          <MDBModalFooter className="justify-content-end">
            <MDBBtn color="primary" outline onClick={this.toggle(10)}>
              Close
            </MDBBtn>
            <MDBBtn color="primary" onClick={this.toggle(10)}>
              Checkout
            </MDBBtn>
          </MDBModalFooter>
        </MDBModal>
      </MDBContainer>
    );
  }
}

export default ModalAgentes;
